import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import {
  createSearchParams,
  useNavigate,
  useParams,
  Link,
} from 'react-router-dom';
import { Tab, Tabs as TabsComponent, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';

function getParamFromUrl(paramName) {
  let url = window.location.search;
  const params = new URLSearchParams(url);
  const paramValue = params.get(`${paramName}`);
  return paramValue ? paramValue : '';
}

const Tabs = ({ razredi = [], predmeti = [] }) => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { idUcenik } = useParams();

  const { idRazred } = useParams();

  /*  const [ucenik] = useSelector((state) =>
    state.ucenici.items.filter((ucenik) => ucenik.idUcenik === +idUcenik)
  ); */

  useEffect(() => {
    navigate('/ucenici/' + idUcenik + '/' + razredi[0].id_razred);
  }, []);

  return (
    <>
      <TabsComponent>
        <TabList>
          {razredi.map((razred, i) => (
            <Tab key={razred.id_razred} active={true}>
              <Link to={'/ucenici/' + idUcenik + '/' + razred.id_razred}>
                {razred.razred}
              </Link>
            </Tab>
          ))}
        </TabList>
      </TabsComponent>
    </>
  );
};

export default Tabs;
